// Gradients

// App Imports
import { primary as primaryColor, primaryAccent, secondary as secondaryColor, secondaryAccent } from '../common/colors'

export const primary = `linear-gradient( 90deg, ${primaryAccent} 10%, ${primaryColor} 100%)`

export const secondary = `linear-gradient( 90deg, ${secondaryAccent} 10%, ${secondaryColor} 100%)`

export const red = `linear-gradient( 90deg, ${red} 10%, ${red} 100%)`
